import "./App.css";
import Planner from "./components/Planner";

const contacts = [
  {
    name: "Martin",
    lastnames: "Lupa Groppelli",
    address: "Armengual de la Mota 41",
    city: "Málaga",
    postalCode: 29007,
    phone: 644644644,
  },
  {
    name: "Pablo",
    lastnames: "Lupa Groppelli",
    address: "Freyre 1431",
    city: "Reconquista",
    postalCode: 3665,
    phone: 123123123,
  },
  {
    name: "Franco",
    lastnames: "Polo Bianchi",
    address: "Fluejanfajen callen",
    city: "Berlin",
    postalCode: 1234,
    phone: 666666666,
  },
];

function App() {
  return (
    <>
      {contacts.map((contact, index) => (
        <div>
          <h2>Contact</h2>
          <Planner
            name={contact.name}
            lastnames={contact.lastnames}
            address={contact.address}
            city={contact.city}
            postalCode={contact.postalCode}
            phone={contact.phone}
          />
        </div>
      ))}
    </>
  );
}

export default App;
